import { Add, Remove } from '@mui/icons-material';
import React from 'react';
import styled from 'styled-components';
import Announcement from '../components/announcements';
import Footer from '../components/footer';
import Navbar from '../components/navbar';

const Container=styled.div`

`
const Wrapper=styled.div`
    height:100vh;
    width: 100vw;
`
const Title=styled.h1`
    text-align: center;
`
const Top=styled.div`
    display:flex;
    justify-content: space-between;
    align-items: center;
`
const Bottom=styled.div`
    display:flex;
    flex-direction: row;


`
const TopButton=styled.button`
    width:130px;
    height:40px;
    margin:20px;
    border:${props=>props.type==='filled' && 'none'};
    background-color: ${props=>props.type==='filled'?'black':'transparent'};
    color:${props=>props.type==='filled' && 'white'};
    cursor:pointer;
`
const Toptext=styled.span`
    text-decoration: underline;
    cursor: pointer;
`
const Info=styled.div`


    flex:3;
    display:flex;
    flex-direction: row;
    align-items: center;
    margin-bottom: 30px;
    margin-top:30px ;
`
const Summary=styled.div`
    flex:1;
    border:2px solid black;

`
const Productdetail=styled.div`

    margin: 20px;
    display: flex;
    flex-direction: column;
    font-size:20px;
`
const Image=styled.img`
        height: 166px;
        width: 265px;
`        
const Productname=styled.div`

`
const Productid=styled.div`

`
const Productcolor=styled.div`
    width:20px;
    height:20px;
    border-radius: 50%;
    background-color: ${props=>props.color};
`
const Productsize=styled.div`

`
const Pricedetail=styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`
const Productamountcontainer=styled.div`
    display: flex;
    flex-direction: row;
    align-items:center;
    justify-content: center;
`
const Productamount=styled.div`
    border: 2px solid maroon;
    border-radius: 5px;
    height: 30px;
    width:30px;
    display :flex;
    align-items: center;
    justify-content: center;
    margin:10px;
    font-size: 30px;
`   
const Productprice=styled.h1`
    font-size: 30px;
`
const Productinfo=styled.div`

`




function Cart(){
    return(
        <Container >
            <Announcement />
            <Navbar/>
            <Wrapper>
                <Title>Your Cart</Title>
                <Top>
                    <TopButton>Continue Shopping</TopButton>
                    <Toptext>Shopping bag(2)</Toptext>
                    <Toptext>Your Cart(0)</Toptext> 
                    <TopButton type='filled'>Checkout</TopButton>
                </Top>
                <Bottom>
                    <Productinfo>
                    <Info>
                    <Image src='https://rukminim1.flixcart.com/image/832/832/xif0q/shoe/y/h/m/7-dj7381-400-8-nike-ashen-slate-black-white-football-grey-original-imagmnc8yhsrndbf.jpeg?q=70'/>
                    <Productdetail>

                            <Productname>
                                <b>Product:</b>NIKE RUNNING
                            </Productname>
                            <Productid><b>ID:</b>NK938738</Productid>
                            <Productcolor color='gray'/>
                            <Productsize><b>SIZE:</b>Uk10</Productsize>

                        </Productdetail>
                        <Pricedetail>
                            <Productamountcontainer>
                                <Add/>
                                <Productamount>2</Productamount>
                                <Remove />
                            </Productamountcontainer>
                            <Productprice>₹6999</Productprice>
                            </Pricedetail>

                    </Info>

                    <Info>
                    <Image src='https://rukminim1.flixcart.com/image/832/832/xif0q/shoe/y/h/m/7-dj7381-400-8-nike-ashen-slate-black-white-football-grey-original-imagmnc8yhsrndbf.jpeg?q=70'/>
                    <Productdetail>

                            <Productname>
                                <b>Product:</b>NIKE RUNNING
                            </Productname>
                            <Productid><b>ID:</b>NK938738</Productid>
                            <Productcolor color='gray'/>
                            <Productsize><b>SIZE:</b>Uk10</Productsize>

                        </Productdetail>
                        <Pricedetail>
                            <Productamountcontainer>
                                <Add/>
                                <Productamount>2</Productamount>
                                <Remove />
                            </Productamountcontainer>
                            <Productprice>₹6999</Productprice>
                            </Pricedetail>

                    </Info>
                    </Productinfo>
                    <Summary>
                       {/* <Summarytitle >
                        ORDER SUMMARY
                       </Summarytitle>
                       <Summaryitem>
                        <Summaryitemtext>Subtotal</Summaryitemtext>
                        <Summaryitemprice>₹12999</Summaryitemprice>
                       </Summaryitem>

                       <Summaryitem>
                        <Summaryitemtext>Delivery Charges </Summaryitemtext>
                        <Summaryitemprice>₹450</Summaryitemprice>
                       </Summaryitem>

                       <Summaryitem>
                        <Summaryitemtext>Discounts</Summaryitemtext>
                        <Summaryitemprice>₹2000</Summaryitemprice>
                       </Summaryitem>

                       <Summaryitem>
                        <Summaryitemtext type='total'>Subtotal</Summaryitemtext>
                        <Summaryitemprice>₹11999</Summaryitemprice>
                       </Summaryitem>
                       <Button>PLACE ORDER</Button> */}
                    </Summary>

                </Bottom>

            </Wrapper>

            <Footer />

        </Container>
    )
}
export default Cart;
